import React from 'react';
import Message from '../Message/Message';

class Dialog extends React.Component {
    render() {
        return <div>
            <span>dialog</span>
            <Message text={'hi'}></Message>
            <Message text={'how are you'}></Message>
            </div>;
    }
}

export default Dialog;
